import {Component} from 'react';
import './App.css';

class App extends Component {

  constructor(){
    super();
    this.state = {
      monsters:[
        {
          name:'Linda',
          id: '123eehgt1',
        },
        {
          name:'Frank',
          id: '123eehgt2',
        },
        {
          name:'Julia',
          id: '123eehgt3',
        },
        {
          name:'Andrei',
          id: '123eehgt4'
        }, 
      ]
    }
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map((monster) => {

            return <div key={monster.id}><h1>{monster.name}</h1></div>
          })
        }
      </div>
    );  
  }
}

export default App;
